import React from 'react'
import * as LottiePlayer from "@lottiefiles/lottie-player";

function Lottie_section() {
    return (
        <div><lottie-player
            autoplay loop mode="normal" src="https://lottie.host/7d5db6b4-6d96-45d9-a260-309d983bf28b/Si0Cv2snX2.json">
        </lottie-player></div>
    )
}

export default Lottie_section
